import React, { useState } from 'react';
import { Draggable, Droppable } from 'react-dnd';
import StaffList from './StaffList';
import Subject from './Subject';
import Table from './Table';

const Timetable = ({ staff, subjects }) => {
  const [table, setTable] = useState([]);

  const onDrop = (subject, index) => {
    // Update the table to include the dropped subject at the given index.
    setTable([...table, subject]);
  };

  return (
    <div className="design">
      <div className="sub">
        <Subject subject={subjects} />
      </div>
      <div className="staffWrapper">
        <div className="staffsss">
          <StaffList staff={staff} />
        </div>
        <div>
          <Table table={table} />
        </div>
      </div>
    </div>
  );
};

export default Timetable;
